import React from 'react';
import { Link } from 'react-router-dom';
import './CSS/Search.css'

class Search extends React.Component{
    render(){
        return(
            <div>
                <SearchBar/>
            </div>
        )

    }
}

class TableResults extends React.Component{
    render(){
        return(
            <div>
            <table>
                <tbody>
                <tr>
                    <th>Rank</th>
                    <th>FoodName</th>
                    <th>Notes</th>
                    <th>Edit</th>
                    <th>Delete</th>
                </tr>
                {this.state.FoodRank.map(info => {return this.TableRow(info)})}
                </tbody>
            </table>
            </div>
        )
    }
}


class SearchBar extends React.Component{
    render(){
        return(
            <div id="searchBarDiv">
            <form>
                <input type="text" id="searchBarText"></input>
                <input type="submit" id="searchBarButton" value ="Search"></input>
            </form>

            </div>
        )
    }
}


export default Search;
